import React from 'react';
import Appbar from './components/AppBar';
import axios from 'axios';
import {useState} from 'react';
import './Cuisine.css';
// import image from './images/french.png';
/**
 * Simple component with no state.
 *
 * See the basic-react example for an example of adding and reacting to
 * changes in state and lecture 10 for details on Material-UI
 *
 * @return {object} JSX
 */
export default function Cuisine() {
  const [cuisineSelected, setCuisine] = useState('');
  const possibleCuisines = [
    {name: 'African', image: require('./images/french.png')},
    {name: 'Asian', image: require('./images/french.png')},
    {name: 'American', image: require('./images/french.png')},
    {name: 'British', image: require('./images/french.png')},
    {name: 'Cajun', image: require('./images/french.png')},
    {name: 'Caribbean', image: require('./images/french.png')},
    {name: 'Chinese', image: require('./images/french.png')},
    {name: 'Eastern European', image: require('./images/french.png')},
    {name: 'European', image: require('./images/french.png')},
    {name: 'French', image: require('./images/french.png')},
    {name: 'German', image: require('./images/french.png')},
    {name: 'Greek', image: require('./images/french.png')},
    {name: 'Indian', image: require('./images/french.png')},
    {name: 'Italian', image: require('./images/french.png')},
    {name: 'Japanese', image: require('./images/french.png')},
    {name: 'Jewish', image: require('./images/french.png')},
    {name: 'Korean', image: require('./images/french.png')},
    {name: 'Latin American', image: require('./images/french.png')},
    {name: 'Mediterranean', image: require('./images/french.png')},
    {name: 'Mexican', image: require('./images/french.png')},
    {name: 'Middle Eastern', image: require('./images/french.png')},
    {name: 'Noradic', image: require('./images/french.png')},
    {name: 'Southern', image: require('./images/french.png')},
    {name: 'Spanish', image: require('./images/french.png')},
    {name: 'Thai', image: require('./images/french.png')},
    {name: 'Vietnamese', image: require('./images/french.png')},
  ];
  console.log(possibleCuisines);
  // GET https://api.spoonacular.com/recipes/{id}/information
  const viewCuisine = (cuisine) => {
    axios
      .get(`https://api.spoonacular.com/recipes/complexSearch`, {
        params: {apiKey: 'c33d1c92ed8343d7b6522ddb630cdfd4', cuisine: cuisine},
      })
      .then((res) => {
        setCuisine(res.data);
      });
  };
  console.log(cuisineSelected);
  return (
    <div>
      <Appbar></Appbar>
      <h1 className='cuisinesTitle'>Cuisines</h1>
      <div className='cuisineOptions'>
        {possibleCuisines?.map((cuisine) => (
          <button
            style={{
              backgroundImage: `url(${cuisine.image})`,
              backgroundRepeat: 'no-repeat',
              backgroundSize: 'cover',
              backgroundPosition: 'center',
            }}
            key={cuisine.name}
            onClick={() => viewCuisine(cuisine.name)}
            className='cuisineButton'
          >
            {cuisine.name}
          </button>
        ))}
      </div>
    </div>
  );
}
